import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import React from "react";
//import Navbar from "./Navbar";
import "./Login.css";


function Signin() {
    return (
        <>
        <form action="">
            <div className="Sign">
                <div className="signup signin">
                    <div className="row">

                        <div style={{ textAlign: "center" }}>
                            <h3 style={{ marginBottom: "30px" }}>SignIn</h3>
                        </div>
                        <div className="col-sm-12 col-md-12 col-lg-12 signupcon">
                            <input className="form-control" type="text" placeholder="Enter User Name" />
                        </div>

                        <div className="col-sm-12 col-md-12 col-lg-12 signupcon" >
                            <input className="form-control signupcon" type="text" placeholder="Password" />
                        </div>

                        <div>
                            <button type="button" className="btn btn-primary" >SignIn</button>
                        </div>
                    </div>
                </div>
            </div>
            </form>
        </>
    );
}
export default Signin;
